int main(void){
    long long res,rw,i,j,n,zh[131072],kh[131072],a[524288];
    data x;
    resheap();
    scanf("%lld",&n);
    for(i=1;i<=3*n;i++){scanf("%lld",&a[i]);}
    rw=0;
    for(i=1;i<=n;i++){
        x.node=i;x.cost=a[i];
        pqpush(x);
        rw+=a[i];
    }
    zh[0]=rw;
    for(i=n+1;i<=2*n;i++){
        x.node=i;x.cost=a[i];
        pqpush(x);
        rw+=a[i];
        x=pqpop();
        rw-=x.cost;
        zh[i-n]=rw;
    }
    swfl=1;
    resheap();
    rw=0;
    for(i=2*n+1;i<=3*n;i++){
        x.node=i;x.cost=a[i];
        pqpush(x);
        rw+=a[i];
    }
    kh[n]=rw;
    for(i=2*n;i>=n+1;i--){
        x.node=i;x.cost=a[i];
        pqpush(x);
        rw+=a[i];
        x=pqpop();
        rw-=x.cost;
        kh[i-n-1]=rw;
    }
    res=-llinf;
    for(i=0;i<=n;i++){
        res=llmax(res,zh[i]-kh[i]);
    }
    printf("%lld\n",res);
    return 0;
}
